import React from 'react';


const Profile = () => {
    return (
        <div className="flex overflow-hidden flex-col justify-center px-24 py-60 w-full max-md:px-5 w-full text-left">
            <section className="text-xl font-medium text-sky-500 max-md:max-w-full">
            Hello there, <br />
            </section>
            <div className="flex flex-col text-left items-start gap-6 pt-3.5 pr-16 pb-16  max-w-full w-fit max-md:pr-5">
                <h1 className="text-6xl font-semibold text-black max-md:max-w-full max-md:text-4xl leading-normal">
                    My name is <br></br> Katherine Ye
                </h1>
                <p className="w-[70%] text-xl leading-8 font-normal text-[color:var(--sds-color-text-default-default)] max-md:mt-10 max-md:max-w-[70%]">
                    I'm a Computer Engineering student at the University of Toronto, dedicated to building innovative integrated solutions and continuously exploring the ever-growing field of technology.
                </p>
                {/*
                <div className="flex items-start mt-0">
                    <div className="flex z-10 shrink-0 mr-0 max-w-full bg-yellow-400 bg-opacity-50 h-[18px] w-[378px]"/>
                    <div className="flex z-10 shrink-0 mt-8 mr-0 max-w-full bg-yellow-400 bg-opacity-50 h-[18px] w-[392px]"/>
                </div>
                */}
            </div>
        </div>
    );
};

const Hero = () => {
  return (
    <div className="flex overflow-hidden flex-col h-dvh">
      <Profile />
    </div>
  );
};

export default Hero;
